import React, { useState } from 'react';
import { Stage, Layer, Rect, Text } from 'react-konva';
import useImage from 'use-image';
import { FaTrash } from 'react-icons/fa';

const AnnotateImage = ({ imageUrl }) => {
  const [image] = useImage(imageUrl);
  const [rectangles, setRectangles] = useState([]);
  const [activeRectangle, setActiveRectangle] = useState(null);
  const [labels, setLabels] = useState([]);
  const [activeLabel, setActiveLabel] = useState(null);

  const handleMouseDown = (e) => {
    if (activeRectangle || activeLabel) {
      return;
    }

    const x = e.evt.offsetX;
    const y = e.evt.offsetY;
    const newRectangle = {
      x,
      y,
      width: 0,
      height: 0,
    };
    setRectangles([...rectangles, newRectangle]);

    const newLabel = {
      x,
      y,
      text: '',
    };
    setLabels([...labels, newLabel]);

    setActiveRectangle(newRectangle);
    setActiveLabel(newLabel);
  };

  const handleMouseMove = (e) => {
    if (!activeRectangle || !activeLabel) {
      return;
    }

    const width = e.evt.offsetX - activeRectangle.x;
    const height = e.evt.offsetY - activeRectangle.y;
    const updatedRectangle = {
      ...activeRectangle,
      width,
      height,
    };
    const updatedRectangles = rectangles.map((rectangle) =>
      rectangle === activeRectangle ? updatedRectangle : rectangle
    );
    setRectangles(updatedRectangles);

    const updatedLabel = {
      ...activeLabel,
      text: '',
    };
    const updatedLabels = labels.map((label) => (label === activeLabel ? updatedLabel : label));
    setLabels(updatedLabels);
  };

  const handleMouseUp = () => {
    setActiveRectangle(null);
    setActiveLabel(null);
  };

  const handleLabelChange = (index, event) => {
    const updatedLabels = [...labels];
    updatedLabels[index] = {
      ...updatedLabels[index],
      text: event.target.value,
    };
    setLabels(updatedLabels);
  };

  const handleDeleteRectangle = (index) => {
    const updatedRectangles = [...rectangles];
    updatedRectangles.splice(index, 1);
    setRectangles(updatedRectangles);

    const updatedLabels = [...labels];
    updatedLabels.splice(index, 1);
    setLabels(updatedLabels);
  };

  return (
    <Stage width={window.innerWidth} height={window.innerHeight}>
      <Layer>
        <Rect width={window.innerWidth} height={window.innerHeight} fill="white" />
        <Text text="Drag and drop an image" />
      </Layer>
      <Layer>
        <Rect image={image} width={window.innerWidth} height={window.innerHeight} />
        {rectangles.map((rectangle, index) => (
          <React.Fragment key={index}>
            <Rect
              x={rectangle.x}
              y={rectangle.y}
              width={rectangle.width}
              height={rectangle.height}
              stroke="red"
              strokeWidth={2}
              draggable
              onDragStart={() => setActiveRectangle(rectangle)}
              onDragEnd={() => setActiveRectangle(null)}
              onTransformStart={() => setActiveRectangle(rectangle)}
              onTransformEnd={() => setActiveRectangle(null)}
              transformsEnabled="position, rotation, scaleX, scaleY"
            />
            <input type="text"
          value={labels[index].text}
          onChange={(event) => handleLabelChange(index, event)}
          style={{
            position: 'absolute',
            left: rectangle.x,
            top: rectangle.y - 30,
            width: rectangle.width,
          }}
        />
        <FaTrash
          className="delete-icon"
          onClick={() => handleDeleteRectangle(index)}
          style={{
            position: 'absolute',
            left: rectangle.x + rectangle.width - 20,
            top: rectangle.y - 30,
          }}
        />
      </React.Fragment>
    ))}
  </Layer>
  <Layer>
    {labels.map((label, index) => (
      <Text
        key={index}
        text={label.text}
        x={label.x}
        y={label.y - 15}
        fontSize={16}
        fontFamily="Arial"
      />
    ))}
  </Layer>
  <Layer listening={false}>
    {activeRectangle && (
      <Rect
        x={activeRectangle.x}
        y={activeRectangle.y}
        width={activeRectangle.width}
        height={activeRectangle.height}
        stroke="red"
        strokeWidth={2}
        dash={[4, 4]}
      />
    )}
  </Layer>
</Stage>
);
};

export default AnnotateImage;
